contracts/vaccineOwnership.sol.content:
pragma solidity ^0.4.19;

import "./vaccineTest.sol";
import "./safemath.sol";
import "./erc721.sol";

contract VaccineOwnership is VaccineTest, ERC721 {
    using SafeMath for uint256;

    mapping (uint => address) vaccineApprovals;

    function balanceOf(address _owner) public view returns (uint256 _balance) {
        return ownerVaccineCount[_owner];
    }

    function ownerOf(uint256 _tokenId) public view returns (address _owner) {
        return vaccineToOwner[_tokenId];
    }

    function _transfer(address _from, address _to, uint256 _tokenId) private {
        ownerVaccineCount[_to] = ownerVaccineCount[_to].add(1);
        ownerVaccineCount[msg.sender] = ownerVaccineCount[msg.sender].sub(1);
        vaccineToOwner[_tokenId] = _to;
        Transfer(_from, _to, _tokenId);
    }

    function transfer(address _to, uint256 _tokenId) public onlyOwnerOf(_tokenId) {
        _transfer(msg.sender, _to, _tokenId);
    }

    function approve(address _to, uint256 _tokenId) public onlyOwnerOf(_tokenId) {
        vaccineApprovals[_tokenId] = _to;
        Approval(msg.sender, _to, _tokenId);
    }

    function takeOwnership(uint256 _tokenId) public {
        require(vaccineApprovals[_tokenId] == msg.sender);
        address owner = ownerOf(_tokenId);
        _transfer(owner, msg.sender, _tokenId);
    }
}

contracts/erc721.sol.content:
pragma solidity ^0.4.19;

contract ERC721 {
  event Transfer(address indexed _from, address indexed _to, uint256 _tokenId);
  event Approval(address indexed _owner, address indexed _approved, uint256 _tokenId);

  function balanceOf(address _owner) public view returns (uint256 _balance);
  function ownerOf(uint256 _tokenId) public view returns (address _owner);
  function transfer(address _to, uint256 _tokenId) public;
  function approve(address _to, uint256 _tokenId) public;
  function takeOwnership(uint256 _tokenId) public;
}

contracts/safemath.sol.content:
pragma solidity ^0.4.19;

/**
 * @title SafeMath
 * @dev Math operations with safety checks that throw on error
 */
library SafeMath {

  /**
  * @dev Multiplies two numbers, throws on overflow.
  */
  function mul(uint256 a, uint256 b) internal pure returns (uint256) {
    if (a == 0) {
      return 0;
    }
    uint256 c = a * b;
    assert(c / a == b);
    return c;
  }

  /**
  * @dev Integer division of two numbers, truncating the quotient.
  */
  function div(uint256 a, uint256 b) internal pure returns (uint256) {
    // assert(b > 0); // Solidity automatically throws when dividing by 0
    uint256 c = a / b;
    // assert(a == b * c + a % b); // There is no case in which this doesn't hold
    return c;
  }

  /**
  * @dev Subtracts two numbers, throws on overflow (i.e. if subtrahend is greater than minuend).
  */
  function sub(uint256 a, uint256 b) internal pure returns (uint256) {
    assert(b <= a);
    return a - b;
  }

  /**
  * @dev Adds two numbers, throws on overflow.
  */
  function add(uint256 a, uint256 b) internal pure returns (uint256) {
    uint256 c = a + b;
    assert(c >= a);
    return c;
  }
}

contracts/vaccineTest.sol.content:
pragma solidity ^0.4.19;

import "./vaccineHelper.sol";
import "./virus.sol";

contract VaccineTest is VaccineHelper, Virus {
    uint randNonce = 0;
    uint successProbability = 70;

    function randMod(uint _modulus) internal returns(uint) {
        randNonce++;
        return uint(keccak256(now, msg.sender, randNonce)) % _modulus;
    }

    function test(uint _vaccineID, uint _virusID) external onlyOwnerOf(_vaccineID) {
        Vaccine storage vaccine = vaccines[_vaccineID];
        Virus storage virus = viruses[_virusID];
        uint rand = randMod(100);
        if (rand <= successProbability) {
            vaccine.cures++;
        }
    }

}

